import React from "react";
import { useEffect } from "react";
import NavBar from "../../components/NavBar";
import "./Basket.css"

const basket = sessionStorage.getItem("basket")

function Basket(){

    useEffect(() => {
        console.log(basket)
    }, [])

    return(
        <>
            <NavBar />
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Price</th>
                        <th>Amount</th>
                        <th>Image</th>
                        <th>Description</th>
                    </tr>
                </thead>
            </table>
        </>
    )
}

export default Basket;
